/* eslint-disable import/prefer-default-export */
export const GetSku = async (idcliente) => {

	var myHeaders = new Headers();
myHeaders.append("Content-Type", "application/json");

var raw = JSON.stringify({
  "id_cliente": "amazon|amzn1.account.AHG4S7Q35E4KB5DZGK6BENXDZ6IQ6"
});

var requestOptions = {
  method: 'POST',
  headers: myHeaders,
  body: raw,
  redirect: 'follow'
};

fetch("https://4clo6vn4y4.execute-api.us-east-1.amazonaws.com/default/shippo-get-account-byseller", requestOptions)
  .then(response => response.text())
  .then(result => console.log(result))
  .catch(error => console.log('error', error));
};
